script: |
  super -f text -I q6260.spq | sort > q6260.out

inputs:
  - name: q6260.spq
    data: |
      SELECT DISTINCT - 28 * col0 + col1 + + col2 / - col0, - col0, + - col0 FROM tab0 (FORMAT parquet) cor0 WHERE NOT NULL BETWEEN col1 * + col0 AND - col1 + - col0 * + col0 * + - 14;
  - name: tab0

outputs:
  - name: q6260.out
    data: |
